import math

def segmented_sieve(start, end):
    limit = int(math.sqrt(end)) - 1
    primes = []
    mark = [True] * limit
    for p in range(2, limit):
        if mark[p]:
            primes.append(p)
            for i in range(p * p, limit, p):
                mark[i] = False
    result = []
    for num in range(start, end + 1):
        if all((num % p != 0 for p in primes)):
            result.append(num)
    return result

